description:
When super-stud Gabriel Pontello meets up with a Lusty Widow, he knows just how to turn her mourning into a moaning .. and her grieving into groaning. After poor Max gets laid to rest, three couples gather to pay their last respects. In their lip-smacking lamenting, the women generously give the widow some sisterly soothing and carnal compassion. And, the handsome hunks find the perfect place to give their dongs a proper burial (relief for even their deepest sorrows.) This is one funeral where Max's body isn't the only thing that's stiff - with a wild, wanton wake that just might raise the dead!

